import logo from "../../../images/icons/icons8-занятая-кровать-64.png";

export const MainInfo = () => {
  return (
    <div className={styles.info}>
      <div className={styles.logo}>
        <img src={logo} alt="" />
        <span>Абсолют</span>
      </div>
      <p>123</p>
    </div>
  );
};
